{"linux":"// Place your key bindings in this file to override the defaultsauto[]
[
	{
		"key": "ctrl+shift+l",
		"command": "editor.action.insertSnippet",
		"when": "editorTextFocus && vim.active && vim.mode == 'Insert'",
		"args": {
			"snippet": "console.log('${TM_SELECTED_TEXT}$1')$2;"
		}
	},
	{
		"key": "ctrl+n",
		"command": "extension.advancedNewFile"
	},
	{
		"key": "ctrl+alt+n",
		"command": "-extension.advancedNewFile"
	},
	{
		"key": "ctrl+oem_period",
		"command": "workbench.action.focusActivityBar"
	},
	{
		"key": "ctrl+oem_comma",
		"command": "workbench.action.toggleActivityBarVisibility"
	},
	{
		"key": "ctrl+w",
		"command": "workbench.action.terminal.kill",
		"when": "terminalFocus"
	},
	{
		"key": "ctrl+d ctrl+b",
		"command": "github.cweijan.mysql.focus"
	},
	{
		"key": "ctrl+w",
		"command": "workbench.action.closeActiveEditor",
		"when": "editorFocus"
	},
	{
		"key": "ctrl+w",
		"command": "-workbench.action.closeActiveEditor"
	},
	{
		"key": "ctrl+n",
		"command": "-workbench.action.files.newUntitledFile"
	},
	{
		"key": "ctrl+alt+win+n",
		"command": "welcome.showNewFileEntries"
	},
	{
		"key": "ctrl+alt+win+n",
		"command": "-welcome.showNewFileEntries"
	},
	{
		"key": "ctrl+shift+d ctrl+shift+d",
		"command": "mysql.connection.add"
	},
	{
		"key": "ctrl+shift+enter",
		"command": "editor.action.goToImplementation",
		"when": "editorHasImplementationProvider && editorTextFocus && !isInEmbeddedEditor"
	},
	{
		"key": "ctrl+f12",
		"command": "-editor.action.goToImplementation",
		"when": "editorHasImplementationProvider && editorTextFocus && !isInEmbeddedEditor"
	},
	{
		"key": "shift+g",
		"command": "-list.focusLast",
		"when": "listFocus && !inputFocus"
	},
	{
		"key": "ctrl+f ctrl+f",
		"command": "references-view.findReferences",
		"when": "editorHasReferenceProvider"
	},
	{
		"key": "shift+alt+f12",
		"command": "-references-view.findReferences",
		"when": "editorHasReferenceProvider"
	},
	{
		"key": "ctrl+shift+s",
		"command": "workbench.action.openSettings2"
	},
	{
		"key": "ctrl+shift+e",
		"command": "workbench.action.toggleSidebarVisibility",
		"when": "sideBarVisible"
	},
	{
		"key": "ctrl+b",
		"command": "-workbench.action.toggleSidebarVisibility"
	},
	{
		"key": "ctrl+f4",
		"command": "workbench.action.closeWindow"
	},
	{
		"key": "ctrl+shift+w",
		"command": "-workbench.action.closeWindow"
	},
	{
		"key": "ctrl+shift+w",
		"command": "workbench.action.closeActiveEditor"
	},
	{
		"key": "ctrl+f4",
		"command": "-workbench.action.closeActiveEditor"
	},
	{
		"key": "ctrl+alt+w",
		"command": "workbench.action.closeAllEditors"
	},
	{
		"key": "ctrl+k ctrl+w",
		"command": "-workbench.action.closeAllEditors"
	},
	{
		"key": "ctrl+shift+k",
		"command": "-editor.action.deleteLines",
		"when": "textInputFocus && !editorReadonly"
	},
	{
		"key": "ctrl+o",
		"command": "-workbench.action.files.openFile",
		"when": "true"
	},
	{
		"key": "ctrl+k o",
		"command": "-workbench.action.files.showOpenedFileInNewWindow",
		"when": "emptyWorkspaceSupport"
	},
	{
		"key": "ctrl+o",
		"command": "-workbench.action.files.openFileFolder",
		"when": "isMacNative && openFolderWorkspaceSupport"
	},
	{
		"key": "ctrl+shift+[IntlBackslash]",
		"command": "-breadcrumbs.focusAndSelect",
		"when": "breadcrumbsPossible && breadcrumbsVisible"
	},
	{
		"key": "ctrl+shift+.",
		"command": "-breadcrumbs.focusAndSelect",
		"when": "breadcrumbsPossible && breadcrumbsVisible"
	},
	{
		"key": "ctrl+shift+;",
		"command": "-breadcrumbs.focus",
		"when": "breadcrumbsPossible && breadcrumbsVisible"
	},
	{
		"key": "ctrl+shift+enter",
		"command": "-editor.action.insertLineBefore",
		"when": "editorTextFocus && !editorReadonly"
	},
	{
		"key": "ctrl+enter",
		"command": "-editor.action.insertLineAfter",
		"when": "editorTextFocus && !editorReadonly"
	},
	{
		"key": "shift+insert",
		"command": "-editor.action.clipboardPasteAction"
	},
	{
		"key": "ctrl+y",
		"command": "-redo"
	},
	{
		"key": "ctrl+k ctrl+u",
		"command": "-editor.action.removeCommentLine",
		"when": "editorTextFocus && !editorReadonly"
	},
	{
		"key": "ctrl+alt+[",
		"command": "editor.action.removeBrackets",
		"when": "editorTextFocus"
	},
	{
		"key": "ctrl+alt+backspace",
		"command": "-editor.action.removeBrackets",
		"when": "editorTextFocus"
	},
	{
		"key": "ctrl+h",
		"command": "-editor.action.startFindReplaceAction",
		"when": "editorFocus || editorIsOpen"
	},
	{
		"key": "f1",
		"command": "workbench.action.showCommands"
	},
	{
		"key": "f1",
		"command": "-workbench.action.showCommands"
	},
	{
		"key": "ctrl+k ctrl+c",
		"command": "-editor.action.addCommentLine",
		"when": "editorTextFocus && !editorReadonly"
	},
	{
		"key": "ctrl+shift+enter",
		"command": "breadcrumbs.focus",
		"when": "vim.active && vim.mode == 'Normal'"
	}
]"}
